import React from 'react';
import { StyleSheet, Text, View, Image, ImageBackground, Button, TouchableOpacity } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>

      <Image style={styles.pic} source={{uri:'https://www.pngkey.com/png/full/194-1946002_logo-logo-penguin-logo-png.png'}}/>
      <Text style={styles.textBrand}>Minguins</Text>
      <Text style={styles.textRed}>Minguins are here for you.</Text>
      <TouchableOpacity
        style={styles.buttonLogin}>
        <Text style={styles.buttonText}>Log in</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.buttonRegister}>
        <Text style={styles.buttonText}>Register</Text>
      </TouchableOpacity>
      <TouchableOpacity
       >
        <Text style={styles.textMore}>Learn more...</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({

  container:{
    backgroundColor:"#12a5b5",
    textAlign:"center",
    padding:25,
    alignItems:"center",
    flex: 1,
    flexDirection: "column",
    justifyContent: 'center',
  },
  textBrand:{
    color:"#f5be33",
    fontSize:60,
  },

  textRed:{
    color:"#d4cfa9",
    fontSize:20,
    margin: 10
  },

  pic:{
    width: 320,
    height: 450,
  },
  buttonLogin: {
    alignItems: "center",
    backgroundColor: "#5178db",
    padding: 10,
    width: 200,
    margin: 10,
    borderRadius: 10
  },

  buttonRegister: {
    alignItems: "center",
    backgroundColor: "#f23f51",
    padding: 10,
    width: 200,
    margin: 10,
    borderRadius: 10
